import { Table, Button, Icon } from 'semantic-ui-react';
import ModalLayout from '../components/ModalLayout';
import RegisterUser from '../components/RegisterUser';
import {useEffect,useState} from 'react';
import axios from 'axios';

export default (props)=>{
    let headerNames;
    ///need header list

    let headerData = [{
        name: Username,
        clickFunction: handleUserClick
    },
    {
        name: Password,
        clickFunction: handlePasswordClick
    },
    {
        name: AdminFlag,
        clickFunction: handleAdminClick
    }]

    ///need body info

    let tableData = [
        { Username: 'maria',Password: '******', AdminFlag: 'n' ,id: 2 },
        { Username: 'admin',Password: '******',AdminFlag: 'y' ,id: 1 }
    ]

    return(
        <Table basic='very' striped sortable celled >
            <Table.Header>
                <Table.Row>
                    {headerData.map(row=>{
                        return (<Table.HeaderCell>
                            {row.name}
                        </Table.HeaderCell>
                    )})}               
                </Table.Row>
            </Table.Header>
            <Table.Body>
            {tableData.map((row) => (
                <Table.Row key={row.id}>
                    {headerData.map(({name})=>(
                        <Table.Cell>{row[name]}</Table.Cell>
                    ))}
                </Table.Row>
            ))}
            </Table.Body>
        </Table>
    );
}
